import React from 'react';
import {PriceCardDisplayV} from './src/PriceCardWidget';


const pricingTable = [
  {
    "key": "free-package",
    "title": "Free",
    "amount":"$28 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "buttonStyle": {
    },
    "list": [
      {
        "li": "Access to basic tutorials",
      },
      {
        "li": "Basic resources",
      },
      {
        "li": "Basic community access",
      },
      {
        "li": "eBooks"
      }
    ]
  },
  {
    "key": "standard-package",
    "title": "Standard",
    "amount":"$50 /month",
    "backgroundColor":"linear-gradient(to top right, #008F69, #ADFFE9)",
    "buttonTitle": "Contact Us",
    "buttonStyle": {
    },
    "list": [
      {
        "li": "Access to basic tutorials",
      },
      {
        "li": "Basic resources",
      },
      {
        "li": "Basic community access",
      },
      {
        "li": "eBooks"
      },
      {
        "li": "Live Data"
      }
    ]
  },
  {
    "key": "premium-package",
    "title": "Premium",
    "amount":"$58 /month",
    "backgroundColor":"linear-gradient(to top right, #E93C0C, #F9A38B)",
    "buttonTitle": "Contact Us",
    "buttonStyle": {
    },
    "list": [
      {
        "li": "Access to basic tutorials",
      },
      {
        "li": "Basic resources",
      },
      {
        "li": "Basic community access",
      },
      {
        "li": "eBooks"
      },
      {
        "li": "Live Data"
      },
      {
        "li": "Access to source files"
      },

    ]
  }
]


const planNameStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  paddingTop:'10px',
  textTransform:'uppercase'
  // marginTop:'5px',
}

const amountStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'35px',
  marginTop:'25px',
  marginBottom:'20px'
}

const listStyles={
  fontSize:"20px",
  color:'white',
  listStyleType:'none',
  textAlign:'left',

}

const buttonStyles={
  fontSize:'20px',
  marginBottom:'30px',
  borderRadius:'25px',
  backgroundColor:'white',
  paddingRight:'60px',
  paddingLeft:'60px',
  paddingTop:'5px',
  paddingBottom:'5px',
  color:'#008F69'
}

const buttonPosition={
  display:'flex',
  justifyContent:'center'
};


function App() {
  return (
    <div>
     <PriceCardDisplayV
     pricingTable={pricingTable}
     planNameStylesStyles={planNameStyles}
     amountStyles={amountStyles}
     listStyles={listStyles}
     buttonStyles={buttonStyles}
     buttonPosition={buttonPosition}
     />
    </div>
  );
}

export default App;
